import React from "react";
import Card from "react-bootstrap/Card";

const ManageUser = () => {
  return (
    <div className="mx-auto my-4 w-75">
      <h3 className="my-2">Manage User</h3>
      <Card className="py-5 px-3"></Card>
    </div>
  );
};

export default ManageUser;
